// ==UserScript==
// @name          イイニャー for mixi
// @namespace     http://www.chipple.net/tools/gmscripts
// @include       http://mixi.jp/*
// @version       1.0
// ==/UserScript==

// フリー素材 -SpiderWorks-
// http://www.spiderworks.jp/ 
var CATS =
	[
		// kitty01
		"",
		// kitty02
		""
	];

var g_iframe;
var g_timeline;
var g_previousTop;
var g_previousBottom;

function getRandomCatHtml() {
	var nbCats = CATS.length;
	var catIndex = Math.min(Math.floor(Math.random() * nbCats), nbCats - 1);
	var html =
		'<audio preload="auto" autoplay>' +
			'<source src="data:audio/ogg;base64,' + CATS[catIndex] + '" type="audio/ogg">' +
		'</audio>';
	return html;
}

function meow() {
	if (g_iframe) {
		document.body.removeChild(g_iframe);
	}
	
	// http://jsdo.it/ebijs/i3IV
	g_iframe = document.createElement("iframe");
	g_iframe.scrolling = "no";
	g_iframe.frameBorder = "0";
	g_iframe.style.cssText = "overflow: hidden; width: 0; height: 0;";
	g_iframe.src = "data:text/html," +
		encodeURIComponent('<!DOCTYPE html><html><body>' + getRandomCatHtml() + '</body></html>');

	document.body.insertBefore(g_iframe, document.body.firstChild);
}

function getTimeline() {
	if (!g_timeline) {
		g_previousTop = g_previousBottom = undefined;
		var container = document.getElementById("JS_timelineContainer");
		if (!container) return;
		var uls = container.getElementsByTagName("ul");
		if (uls.length == 0) return;
		g_timeline = uls[0];
	}
	return g_timeline;
}

function cattifyOne(item) {
	var as = item.getElementsByTagName("a");
	for (var i = 0; i < as.length; i++) {
		var a = as[i];
		if (a.getAttribute("data-widget-namespace") != "jp.mixi.home.pc.widget.feedbackbutton")
			continue;
		a.title = "イイニャー";
		a.innerHTML = "<span>イイニャー</span>";
		a.style.backgroundImage = "url(data:image/png;base64,)";
		a.addEventListener("click", meow);
	}
}

function cattify() {
	var timeline = getTimeline();
	if (!timeline) {
		return;
	}
	if (!g_previousTop) {
		var lis = timeline.getElementsByTagName("li");
		if (lis.length == 0) return;
		g_previousTop = g_previousBottom = lis[0];
		cattifyOne(g_previousTop);
	}
	var item = g_previousTop;
	while (item = item.previousSibling) {
		if (item.tagName != "LI") continue;
		cattifyOne(item);
		g_previousTop = item;
	}
	item = g_previousBottom;
	while (item = item.nextSibling) {
		if (item.tagName != "LI") continue;
		cattifyOne(item);
		g_previousBottom = item;
	}
}

function onLoad() {
	g_timeline = getTimeline();
	if (!g_timeline) return;
	setInterval(cattify, 1000);
	//setInterval(meow, 1000);  // NOTE: For testing
}

if (window.top == window) {
	window.addEventListener("load", onLoad);
}